import React from 'react'
import {Link} from 'react-router-dom'

const Navbar = () => {
  return (
    <nav>
        <Link to='/'>Maintenance Management System &trade; </Link>
        <Link to='/create'>Create</Link>
        <Link to='/about'>About</Link>
    </nav>
  )
}

export default Navbar
